  const baseUrl = "/v1/comm_messages";
  import type {CommMessage} from "../models/CommMessage"

  const method = "GET"

  const urlBuilder = (base: string, items: Record<string, unknown>) => {
    let newUrl = baseUrl
    for (const key in items) {
      newUrl = newUrl.replaceAll(`{${key}}`, `${items[key]}`)
    }

    return base + newUrl
  }

export const list_of_commmessages_for_user = async (token: string, baseUrl: string, params: {
  "user_id": string;"start_time"?: undefined;"end_time"?: undefined
}) => {
  console.log(token)
  const r = await fetch(urlBuilder(baseUrl, params), {
    method: method,
    headers: {
      "Authorization": "Bearer " + token
    }
  })
  if(r.status != 200) {
    console.error(r)
    return undefined
  }
  return (await r.json()) as CommMessage[]
}
